  return (
    <div className="App">
      <header className="App-header">
        <p className="App-title">FlaskTyping</p>
        <p>this is header.</p>
      </header>
      <body className="App-body">
        <p>this is body</p>
        <p className="App-question">{nowQuestion}</p>
        <input className="App-ask"
        onChange={(e)=>chgTex(e.target.value)}
        ></input>
        <p>{inptTex}</p>
      </body>
    </div>
  );
}

export default App;
